import React from 'react';
import Layout from '../../components/Layout';
import { SectionTitle, Pill } from '../../styles';
import {ImageContainer, ProjectItem, ProjectTitle, SkillContainer} from './styles';

const Projects = ({ user }) => {
  return (
    <Layout user={user}>
      <div>
        <SectionTitle>Projects</SectionTitle>
        <ul>
          {user.projects.map((project, i) => (
            <ProjectItem key={i}>
              <ProjectTitle>{project.displayName}</ProjectTitle>
              <p>{project.summary}</p>
              <p>{project.images.resolution}</p>

              <SkillContainer>
                {[...project.languages, ...project.libraries,].map((item, j) => (
                  <Pill key={j}>{item}</Pill>
                ))}
              </SkillContainer>
                <ImageContainer>{project.images.resolutions.map((item, index) => {
                { item.resolutions.map((c, i) => <div>
                    <h3>{c.title}</h3>
                    <h3>{c.description}</h3>
                    </div>)}
                })}}</ImageContainer>
            </ProjectItem>
          ))}
        </ul>
      </div>
    </Layout>
  );
};

export default Projects;
